window.bookSummaryJSON = "<p><b>Sylvain Neuvel's </b><b><i>Until the Last of Me</i></b><b> is a darkly satirical first contact thriller, as seen through the eyes of the women who make progress possible and the men who are determined to stop them.</b><br> <br> <i>Always run, never fight.</i><br> <i>Preserve the knowledge.</i><br> <i>Survive at all cost.</i><br> <i>Take them to the stars.</i></p> <p>Over 100 identical generations, Miaâ€™s family has shaped earth history to push humanity to the stars, making brutal, wrenching choices and sacrificing countless lives.</p> <p>After nudging the human race through the dawn of rocket technology, Mia finds herself about to help launch the first people into space. She can't take them to the stars, not quite yet, but she's getting them ever closer...</p> <p>But a terrible adversary is upon her, threatening the future of <i>two</i> species...</p> <p><b>A Macmillan Audio production from Tor.com</b></p>"; 
